// SPDX-License-Identifier: MIT
pragma solidity ^0.8.25;

import "./SSTORE2.sol";

contract TwoSectorRenderer {
    address public immutable sectorPtr;

    // 0 → белый, 1 → чёрный
    string[2] private PAL = ["#ffffff", "#000000"];

    // углы поворота двух секторов
    string[2] private ANG = ["0", "5.625"]; // можно менять / расширять

    constructor(address _sectorPtr) {
        sectorPtr = _sectorPtr;
    }

    /// Возвращает SVG-фрагмент из **двух** секторов
    /// 0101 (0b0101) ↔ c1=#fff, c2=#000, c3=#fff, c4=#000
    /// 1001 (0b1001) ↔ c1=#000, c2=#fff, c3=#fff, c4=#000
    function getSVG() external view returns (string memory) {
        bytes memory tmpl = SSTORE2.read(sectorPtr);

        bytes memory first  = _wrap(_applyColor(tmpl, 0x05), ANG[0]);
        bytes memory second = _wrap(_applyColor(tmpl, 0x09), ANG[1]);


        return string(bytes.concat(first, second));
    }

    /*------------------------------------------------------------*/
    /*                  INTERNAL HELPERS                          */
    /*------------------------------------------------------------*/

    function _wrap(bytes memory core, string memory angle)
        private
        pure
        returns (bytes memory)
    {
        return abi.encodePacked('<g transform="rotate(', angle, ' 512 512)">', core, '</g>');
    }

    function _applyColor(bytes memory src, uint8 bits)
        private
        view
        returns (bytes memory)
    {
        bytes memory out = src;

        out = _subst(out, "c_1", PAL[(bits >> 3) & 1]);
        out = _subst(out, "c_2", PAL[(bits >> 2) & 1]);
        out = _subst(out, "c_3", PAL[(bits >> 1) & 1]);
        out = _subst(out, "c_4", PAL[ bits       & 1]);

        return out;
    }

    /// простая search-and-replace (как у вас в примере)
    function _subst(
    bytes memory input,
    string memory key,
    string memory value
    ) private pure returns (bytes memory) {
        bytes memory k = bytes(key);
        bytes memory v = bytes(value);
        uint256 extra  = (v.length > k.length) ? (v.length - k.length) : 0;
        bytes memory tmp = new bytes(input.length + extra * 4); // небольшой запас

        uint256 idx;
        for (uint256 i; i < input.length; ) {
            bool isMatch = true;                              // ← было `match`
            if (i + k.length > input.length) isMatch = false;
            else {
                for (uint256 j; j < k.length && isMatch; ++j) {
                    if (input[i + j] != k[j]) isMatch = false;
                }
            }

            if (isMatch) {
                for (uint256 j; j < v.length; ++j) tmp[idx++] = v[j];
                i += k.length;
            } else {
                tmp[idx++] = input[i++];
            }
        }

        bytes memory fin = new bytes(idx);
        for (uint256 j; j < idx; ++j) fin[j] = tmp[j];
        return fin;
    }

}

